// Services.js
import React, { useState, useEffect } from "react";
import Modal from "react-modal";
import "./services.css";

const Services = () => {
  useEffect(() => {
    const root = document.getElementById("root");
    if (root) {
      Modal.setAppElement(root);
    }
  }, []);

  const servicesData = [
    { title: "Individual Therapy", description: "One-on-one sessions to help you navigate personal challenges and improve mental well-being.", icon: "🧠" },
    { title: "Couples Therapy", description: "Sessions designed to enhance communication and resolve conflicts in relationships.", icon: "❤️" },
    { title: "Group Therapy", description: "Join a supportive group setting to share experiences and gain insights.", icon: "👥" },
    { title: "Child and Adolescent Therapy", description: "Specialized therapy for young individuals dealing with various emotional challenges.", icon: "👶" },
    { title: "Online Therapy", description: "Access professional support from the comfort of your home through secure online sessions.", icon: "💻" },
    { title: "Career & Life Coaching", description: "Guidance and support to help you achieve personal and professional goals.", icon: "🎯" },
    { title: "Self Assessment", description: "Take quick mental health assessments to better understand your well-being.", icon: "📊" },
  ];

  const timeSlots = [
    "10:00 AM - 12:00 PM",
    "12:00 PM - 2:00 PM",
    "2:00 PM - 4:00 PM",
    "4:00 PM - 6:00 PM",
    "6:00 PM - 8:00 PM",
  ];

  const therapyServices = {
    "Individual Therapy": ["Stress Management", "Depression Counseling", "Anxiety Therapy", "Self-Improvement"],
    "Couples Therapy": ["Relationship Counseling", "Marriage Therapy", "Conflict Resolution", "Pre-Marital Counseling"],
    "Group Therapy": ["Ex-Defence Personnel", "Widows", "Divorcees", "LGBTQ+ Support", "Substance Recovery Groups"],
    "Child and Adolescent Therapy": ["Behavioral Therapy", "Academic Stress Management", "Bullying Support", "Parental Guidance"],
    "Online Therapy": ["Virtual Individual Sessions", "Video Counseling", "Text-Based Therapy", "Phone Consultations"],
    "Career & Life Coaching": ["Career Counseling", "Goal Setting", "Work-Life Balance", "Entrepreneurship Guidance"],
  };

  const [showForm, setShowForm] = useState(false);
  const [showPaymentPopup, setShowPaymentPopup] = useState(false);
  const [showSuccessPopup, setShowSuccessPopup] = useState(false);
  const [selectedService, setSelectedService] = useState("");
  const [formData, setFormData] = useState({
    name: "",
    spouseName: "",
    childName: "",
    mobile: "",
    email: "",
    date: "",
    time: "",
    service: "",
  });

  const [showAssessmentPopup, setShowAssessmentPopup] = useState(false);
  const [quizType, setQuizType] = useState("");
  const [quizResult, setQuizResult] = useState(null);
  const [quizAnswers, setQuizAnswers] = useState({});

  const quizzes = {
    ADHD: [
      { id: "q1", question: "Do you often struggle to concentrate?", type: "yesno" },
      { id: "q2", question: "Are you easily distracted by surroundings or thoughts?", type: "yesno" },
      { id: "q3", question: "Do you find it hard to complete tasks?", type: "yesno" },
    ],
    Anxiety: [
      { id: "q1", question: "Do you often feel nervous or anxious?", type: "yesno" },
      { id: "q2", question: "Do you worry excessively about different things?", type: "yesno" },
      { id: "q3", question: "Do you experience physical symptoms like sweating or rapid heartbeat?", type: "yesno" },
    ],
    OCD: [
      { id: "q1", question: "Do you have repeated thoughts that make you anxious?", type: "yesno" },
      { id: "q2", question: "Do you feel compelled to perform certain rituals?", type: "yesno" },
      { id: "q3", question: "Do these behaviors interfere with your daily life?", type: "yesno" },
    ],
  };

  const today = new Date();
  today.setDate(today.getDate() + 1);
  const minDate = today.toISOString().split("T")[0];

  const handleInputChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleNextToPayment = (e) => {
    e.preventDefault();
    setShowPaymentPopup(true);
  };

  const handleFinalSubmit = async () => {
    const token = localStorage.getItem("token");
    if (!token) {
      alert("You must be logged in to book an appointment.");
      return;
    }

    const appointmentData = {
      name: formData.name,
      spouseName: formData.spouseName,
      childName: formData.childName,
      mobile: formData.mobile,
      email: formData.email,
      date: formData.date,
      time: formData.time,
      mainService: selectedService,
      subService: formData.service,
    };

    try {
      const response = await fetch("http://localhost:5000/api/appointments", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify(appointmentData),
      });

      const data = await response.json();

      if (response.ok) {
        setShowSuccessPopup(true);
        setShowForm(false);
        setShowPaymentPopup(false);
        setFormData({
          name: "",
          spouseName: "",
          childName: "",
          mobile: "",
          email: "",
          date: "",
          time: "",
          service: "",
        });
      } else {
        alert(`❌ ${data.message || "Something went wrong!"}`);
      }
    } catch (err) {
      console.error(err);
      alert("❌ Failed to connect to the server.");
    }
  };

  const handleSelfAssessment = () => {
    setSelectedService("Self Assessment");
    setShowAssessmentPopup(true);
  };

  return (
    <div className="services-container">
      <h1 className="services-title">Our Services</h1>
      <p className="services-description">
        Explore the range of therapy services we offer to support your mental health journey.
      </p>
      <div className="services-grid">
        {servicesData.map((service, index) => (
          <div
            key={index}
            className="service-card"
            onClick={() => {
              if (service.title === "Self Assessment") {
                handleSelfAssessment();
              } else {
                setSelectedService(service.title);
                setFormData({
                  name: "",
                  spouseName: "",
                  childName: "",
                  mobile: "",
                  email: "",
                  date: "",
                  time: "",
                  service: therapyServices[service.title][0],
                });
                setShowForm(true);
              }
            }}
          >
            <div className="service-icon">{service.icon}</div>
            <h2 className="service-title">{service.title}</h2>
            <p className="service-description">{service.description}</p>
          </div>
        ))}
      </div>

      {/* Existing modals and forms remain unchanged */}
      {/* Assessment Modal is already implemented below and triggered by new service now */}

      <Modal
        isOpen={showAssessmentPopup}
        onRequestClose={() => {
          setShowAssessmentPopup(false);
          setQuizType("");
          setQuizAnswers({});
          setQuizResult(null);
        }}
        className="popup-form"
        overlayClassName="popup-overlay"
      >
        <h2>📊 Mental Health Self Assessment</h2>
        {!quizType ? (
          <div className="self-assessment-buttons">
            {["ADHD", "Anxiety", "OCD"].map((type) => (
              <button
                key={type}
                type="button"
                onClick={() => setQuizType(type)}
                className="self-assessment-btn"
              >
                {type} Test
              </button>
            ))}
          </div>
        ) : quizResult ? (
          <>
            <p><strong>Result:</strong> {quizResult}</p>
            <button onClick={() => { setQuizResult(null); setQuizAnswers({}); }}>Retake</button>
            <button onClick={() => { setQuizType(""); }}>Back</button>
          </>
        ) : (
          <>
            {quizzes[quizType]?.map((q) => (
              <div key={q.id}>
                <label>{q.question}</label>
                <select
                  onChange={(e) =>
                    setQuizAnswers({ ...quizAnswers, [q.id]: e.target.value })
                  }
                  required
                >
                  <option value="">Select</option>
                  <option value="yes">Yes</option>
                  <option value="no">No</option>
                </select>
              </div>
            ))}

            <button
              onClick={() => {
                const score = Object.values(quizAnswers).filter((val) => val === "yes").length;
                let resultText = "Minimal signs detected. No strong indicators.";
                if (score >= 2) resultText = "Moderate signs present. Consider consulting a professional.";
                if (score === 3) resultText = "High indicators. Professional help recommended.";
                setQuizResult(resultText);
              }}
              disabled={Object.keys(quizAnswers).length < 3}
            >
              Submit
            </button>
          </>
        )}
      </Modal>

      {/* Payment and success modals stay unchanged */}
    </div>
  );
};

export default Services;
